import React from 'react';
import login from '../../assets/images/appointment.png';
const Contact = () => {
    return (
        <div style={{background:`url(${login})`}} className='contact'>
            <h6 className="title">
                Contact Us
            </h6>
        </div>
    );
};

export default Contact;
